import React from 'react'
import './Card.css';
import Todo from './Todo';




const date = new Date();
const getDate = date.getDate();
const getMonth = date.getMonth();
const getYear = date.getFullYear();



function Card() {
  return (
    <div className="container">
    <Todo  title="Bangladesh" getDate={getDate}  getMonth={getMonth} getYear={getYear} description="very attractive " />
  </div>
  )
}

export default Card
